//Based on this: https://www.shadertoy.com/view/XtdSRs by leavittx
//Told ChatGPT to get rid of the extra stuff.
//Usage instructions:
//  - Open the javascript console of your browser:
//				   Mac      /     Windows
//	Chrome:  cmd + opt + J  /  ctrl + shift J
//	Firefox: cmd + opt + K  /  ctrl + shift K
//    IE:          na         /  F12   
//	
//  - Paste the following line and hit enter:
//
//	   gShaderToy.SetTexture(0, {mSrc:'data:image/png;base64,', mType:'texture', mID:1, mSampler:{ filter: 'mipmap', wrap: 'repeat', vflip:'true', srgb:'false', internal:'byte' }});
//

#define COLS 16.0
#define ROWS 16.0
#define START_CODE 33
#define CHARS_COUNT 94

float pxRange = 2.0;

float median_of_three(vec3 v){
    return max(min(v.x, v.y), min(max(v.x, v.y), v.z));
}

float sdf_to_alpha(float x){
    return clamp(x / fwidth(x), 0.0, 1.0);
}

float remap(float x, vec2 from, vec2 to)
{
    return to.x + (x - from.x) / 
        (from.y - from.x) * (to.y - to.x);
}

vec2 getCharacterUV(vec2 uv, int code)
{
    float row = float((code - START_CODE) / int(COLS));
    float col = float(float(code - START_CODE) - COLS * row);
    float stepX = 1.0 / COLS, stepY = 1.0 / ROWS;
    vec2 tileX = vec2(col * stepX, (col + 1.0) * stepX);
    vec2 tileY = vec2((ROWS - (row + 1.0)) * stepY, 
                      (ROWS - row) * stepY);

    vec2 result = vec2(remap(uv.x, vec2(0, 1), tileX), 
                       remap(uv.y, vec2(0, 1), tileY));

    return result;
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord.xy / iResolution.xy;

    int code = START_CODE + int(iMouse.x / iResolution.x * float(CHARS_COUNT));    

    // Compute the character uv
    vec2 cuv = getCharacterUV(uv, code);

    vec3 msd = texture(iChannel0, cuv).rgb;

    vec2 msdfSize = iResolution.xy;
    float pxSize = min(0.5/pxRange*(fwidth(cuv.x)*msdfSize.x+fwidth(cuv.y)*msdfSize.y), 0.25);

    float sd = 2.0 * median_of_three(msd) - 1.0; // Use median_of_three from parta
    float inside = sdf_to_alpha(sd); // Use sdf_to_alpha from parta

    fragColor = vec4(mix(vec3(0.0), vec3(1.0), inside), 1.0);
}
